const ProductForm = () => {
  return (
    <div>
      <h4>상픔 등록 페이지</h4>
      <div>
        <form>
          <div>
            <label for="title_id">상품 제목 : </label>
            <input type="text" id="title_id" name="title"  />
          </div>
          <div>
            <label for="price_id">상품 가격 : </label>
            <input type="number" id="price_id" name="price" />
          </div>
        </form>
      </div>
    </div>
  );
};

export default ProductForm;
